	<title>Werners Kaffeestube</title>
	<style type="text/css">
		body, html {
			width: 100%;
			height: 100%;
			margin: 0;
			padding: 0
		}

		#header {
			position: absolute;
			height: 60px;
			width: 100%;
			display: block;
			float: left;
		}

		ul {
			list-style-type: none;
			margin: 0;
			padding: 0;
			overflow: hidden;
			background-color: #333;
			float: left;
			width: 100%;
		}

		li {
			float: left;
		}

			li a {
				display: block;
				color: white;
				text-align: center;
				padding: 14px 16px;
				text-decoration: none;
			}

				/* Change the link color to #111 (black) on hover */
				li a:hover {
					background-color: #111;
				}

		.active {
			background-color: #5e9cff;
		}

		#logo {
			position: static;
			z-index: 0;
			float: right;
			height: 60px;
			vertical-align: top;
			margin-bottom: -40px;
			margin-top: -50px;
			background: #ffffff;
			padding-left: 10px;
		}

		#content {
			position: absolute;
			top: 60px;
			left: 0px;
			right: 0px;
			bottom: 0px;
		}

			#content iframe {
				width: 100%;
				height: 100%;
				border: none;
			}

		tr:nth-child(even) {
			background: #a9a9a9
		}

		tr:nth-child(odd) {
			background: #FFF
		}
	</style>
	<script type="text/javascript">
		function onNavigate(e) {
			var links = document.getElementsByTagName("a");
			for (var i = 0; i < links.length; i++) {
				links[i].className = "";
			}
			e.className = "active";
			var target = e.href;
			target = target.substr(target.lastIndexOf('/') + 1);
			location = location.pathname + "#" + target;
		}
		function navigateToAnchor() {
			var target = null;
			var currenttarget = null;
			currenttarget = target = location.hash.replace('#', '');
			if (target == null || target == "")
				target = "start.htm";
			var content = document.getElementById('contentiframe');
			content.src = target;
			if (currenttarget != target) {
				location = location.pathname + "#" + target;
			}

			var links = document.getElementsByTagName("a");
			for (var i = 0; i < links.length; i++) {
				if (links[i].href.substr(links[i].href.lastIndexOf('/') + 1) == target)
					links[i].className = "active";
				else
					links[i].className = "";
			}
		}
	</script>
